import './EspacoJogos.css'
import Jogo from '../Jogo'


const EspacoJogos = () => {

    const Jogos = [
        {
            titulo: '2831293812093',
            texto1: 'sdasdsad',
            texto2: 'dasdasdasda',
            imagem1: './imagens/grazinha.png',
            imagem2: './imagens/bkgGiga2.png'
        },
        {
          titulo: '12462163',
          texto1: 'sdasdsad',
          texto2: 'dasdasdasda',
          imagem1: './imagens/dashAndGetOut.png',
          imagem2: './imagens/grazinha_bkg.png'
        }
    ]

    return (
        <section>
            {Jogos.map(jogo => 
            <Jogo 
            key={jogo.titulo} 
            titulo={jogo.titulo} 
            texto1={jogo.texto1} 
            texto2={jogo.texto2} 
            imagem1={jogo.imagem1} 
            imagem2={jogo.imagem2}
            />)}
        </section>
    )
}

export default EspacoJogos
